import React from 'react';
import './Login.css';
import Logo from './Land_Logo.png';


const Login = () => {
  return (
    
    <div className='container'>
        <div className='header'>
            <img className="site_logo"src={Logo} alt='Site_Logo'/>
            <h1>LORS</h1>
        </div>
        <div className='underline'>Connect Your Wallet</div>
        <div className='wallet_button'>
            <button className='connect'>CONNECT</button></div>
            <h4>Link Your MetaMask Wallet</h4>
    </div>
        
  )
}

export default Login
